import React from 'react';
import { FaUnderline } from 'react-icons/fa';
import { BsStar, BsDownload, BsLightbulb } from 'react-icons/bs';
import { BiLineChart, BiNotification } from 'react-icons/bi';
import { MdOutlineMessage, MdEmojiPeople, MdOutlineWidgets } from 'react-icons/md';
import { VscSettings } from 'react-icons/vsc';
import './SidebarLeft.css';

const SidebarLeft = () => {
    return (
        <div>
            <div className="sidebar-left">
                <div className="d-flex justify-content-center mt-4">
                    <FaUnderline className="sidebar-left-icon" />
                </div>
                <div className="d-flex justify-content-center mt-4 pt-3">
                    <BsStar className="sidebar-left-icon" />
                </div>
                <div className="d-flex justify-content-center mt-4 pt-3">
                    <BiLineChart className="sidebar-left-icon" />
                </div>
                <div className="d-flex justify-content-center mt-4 pt-3">
                    <BsDownload className="sidebar-left-icon" />
                </div>
                <div className="d-flex justify-content-center mt-4 pt-3">
                    <MdOutlineMessage className="sidebar-left-icon" />
                </div>
                <div className="d-flex justify-content-center mt-4 pt-3">
                    <VscSettings className="sidebar-left-icon" />
                </div>
                <div className="d-flex justify-content-center mt-4 pt-3">
                    <BsLightbulb className="sidebar-left-icon" />
                </div>
                <div className="d-flex justify-content-center mt-4 pt-3">
                    <MdEmojiPeople className="sidebar-left-icon" />
                </div>
                <div className="d-flex justify-content-center mt-4 pt-3">
                    <MdOutlineWidgets className="sidebar-left-icon" />
                </div>
                <div className="d-flex justify-content-center mt-4 pt-3">
                    <BiNotification className="sidebar-left-icon" />
                </div>
            </div>
        </div>
    );
};

export default SidebarLeft;
